<div class="entities" style="line-height: 2.5; direction: ltr">Global gene expression profiles of subcutaneous adipose and muscle from glucose-tolerant , insulin-sensitive , and insulin-resistant individuals matched for BMI . OBJECTIVE : To determine altered gene expression profiles in subcutaneous adipose and skeletal muscle from nondiabetic , insulin-resistant individuals compared with insulin-sensitive individuals matched for BMI . RESEARCH DESIGN AND METHODS : A total of 62 nondiabetic individuals were chosen for extremes of insulin sensitivity ( 31 insulin-resistant and 31 insulin-sensitive subjects ; 40 were European American and 22 were African American ) and matched for age and obesity measures . Global gene expression profiles were determined and compared between ethnic groups and between insulin-resistant and insulin-sensitive participants individually and using gene-set enrichment analysis . RESULTS : African American and European American subjects differed in 58 muscle and 140 adipose genes , including many inflammatory and metabolically important genes . Peroxisome proliferator-activated receptor γ cofactor 1A ( Q9UBK2 ) was 1.75- fold reduced with insulin resistance in muscle , and fatty acid and lipid metabolism and oxidoreductase activity also were downregulated . Unexpected categories included ubiquitination , citrullination , and protein degradation . In adipose , highly represented categories included lipid and fatty acid metabolism , insulin action , and cell-cycle regulation . Inflammatory genes were increased in European American subjects and were among the top Kyoto Encyclopedia of Genes and Genomes pathways on gene-set enrichment analysis .
